import React, { useState } from 'react';
import './BookingsPage.css';
import logo from './logo.png';

function BookingsPage() {
    // Sample booking data
    const bookings = [
      {
        id: 1,
        hotelName: 'Grand Plaza Hotel',
        checkInDate: '2024-09-01',
        checkOutDate: '2024-09-05',
        status: 'Confirmed',
      },
      {
        id: 2,
        hotelName: 'Oceanview Resort',
        checkInDate: '2024-10-15',
        checkOutDate: '2024-10-20',
        status: 'Pending',
      },
      {
        id: 3,
        hotelName: 'Mountain Lodge',
        checkInDate: '2024-11-10',
        checkOutDate: '2024-11-15',
        status: 'Cancelled',
      },
    ];
  
    return (
      <div className="bookings-page">
        <div className="logo-container">
      <img src={logo} alt="Hotel Reservations App" className="home-logo" />
      </div>
        <h1>Your Bookings</h1>
        <div className="bookings-list">
          {bookings.map((booking) => (
            <div key={booking.id} className="booking-item">
              <h2>{booking.hotelName}</h2>
              <p><strong>Check-In:</strong> {booking.checkInDate}</p>
              <p><strong>Check-Out:</strong> {booking.checkOutDate}</p>
              <p><strong>Status:</strong> {booking.status}</p>
              <div className="booking-actions">
                <button className="details-button">View Details</button>
                {booking.status !== 'Cancelled' && (
                  <button className="cancel-button">Cancel Booking</button>
                )}
              </div>
            </div>
          ))}
        </div>
      </div>
    );
  }
  
  export default BookingsPage;
